import React from 'react'

export default function WeeklyWeather(weather) {
  return (
    <div className={
      typeof weather.main != "undefined"
        ? weather.main.temp > 16
          ? "weather_container warm"
          : "weather_container"
        : "weather_container"
    }
    >

    </div>
  )
}
